const Avatarlist = (props) => {
 return(
    <div className="Avatarstyle ma4 bg-light-purple dib pa3 tc">
        <img src={`https://joeschmoe.io/api/v1/${props.name}`} alt="avatar" />
    <h1 className=""> {props.name} </h1>
    <p> {props.work} </p>
 </div>
    )
}
export default Avatarlist;
